export default (function (event) {
  var overrides = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : {};
  event.persist();
  Object.keys(overrides).forEach(function (key) {
    Object.defineProperty(event.target, key, {
      writable: true,
      value: overrides[key]
    });
  });
  return event;
});
